Dorp met 1195 inwoners (CBS, 2021) wordt tijdelijk dorp met 1695-1895 inwoners. Stijging van 42-59%. 

Ter vergelijk: Amsterdam zou er dan ongeveer 450.000 inwoners bijkrijgen, Rotterdam ongeveer 300.000, Den Haag ongeveer 275.000 en Utrecht ongeveer 180.000.

